import './App.css';
import {useEffect} from 'react'
import {connect} from 'react-redux'
import Navbar from '../components/Navbar';
import { Routes, Route, Switch } from 'react-router-dom';
import ErrorBoundary from '../components/ErrorBoundary';
import Home from '../components/Home';
import About from '../components/About';
import Contact from '../components/Contact'
import Post from '../components/Post';

function App(props) {
  return (
    <div className="App">
     <Navbar/>
     <Switch>
      <Route exact path="/" element={<ErrorBoundary><Home posts={props.posts}/></ErrorBoundary>} />
      <Route exact path="/about" element={<ErrorBoundary><About posts={props.posts}/></ErrorBoundary>} />
      <Route exact path="/contact" element={<ErrorBoundary><Contact posts={props.posts}/></ErrorBoundary>} />
      <Route exact path="/post/:id" element={<ErrorBoundary><Post/></ErrorBoundary>} />
     </Switch>
    </div>

  );
}

const mapStateToProps = (state) => {
  return {
      posts: state.posts,
  }
}

// const mapDispatchToProps = (dispatch)=> {
//   return {
//     searchFieldChng: (txt) => dispatch(searchFieldChange(txt)),
//     getRobots: ()=>(getRobots(dispatch))
//   }
// }

export default connect(mapStateToProps)(App)
